import React from "react";
import sData from './cardLists';
import Cards from "./Cards";

function Trending(){
    return (<Cards
                key={sData[0].key} 
                srcImage={sData[0].srcImage} 
                title={sData[0].title} 
                typeTrend={sData[0].typeTrend}
            />
            
            )

}

export default Trending;
